function Createanime() {


    const submit = () => {
        axios
            .post("http://localhost:8080/api/auth/reg", {
                username: username, 
                email: email, 
                passwords: passwords, 
                bio: bio, 
                dates: dates
            }, 
            {withCredentials: true})
            
            .then((response) => {
                console.log(response)
                setData(response)

                if(response.status === 200) {
                    dispatch(addauth())
                    nav('/profile')
                }
            })
            
            .catch((error) => {
                console.log('Ошибка : ',error)
            })
    }; 


    return (  
        <>
            Create anime!
        </>
    );
}

export default Createanime;
